import React from 'react';

const Profile = () => {
  return (
    <div className="glass-card p-6 rounded-2xl">
      <h1 className="text-2xl font-bold text-gray-900 mb-4">Profile</h1>
      <p className="text-gray-600">Profile page coming soon...</p>
    </div>
  );
};

export default Profile;
